import React, { Component } from 'react';
import SingleVideo from "./SingleVideo";


const API_KEY = '406d1d67-cd68-4d5f-be46-11656b50339d';
const baseUrl = 'https://project-2-api.herokuapp.com/';
const endpoint= "videos";
const queryString= "?api_key=" + API_KEY;


class VideoList extends React.Component {
  state = {
    serverdata: [],
    }
    //GET REQUEST
    componentDidMount() {
        fetch(baseUrl+ endpoint + queryString)
        .then(response  => response.json())
        .then (data => {
        console.log(data);
        //now we wanna put in the sate=> set state
        this.setState({
        //now we have data
        serverdata: data,
        })
        console.log(serverdata);
    });
    } 

    render() {

      let videos= this.props.serverdata;
      const videoElements= videos.map((video) => {
        return <SingleVideo
        id= {video.id}
        name= {video.name}
        username= {video.username}
        views= {video.views}
        src= {video.src}
        ></SingleVideo>
    });

     return (
         <section className="listvideo">
          <h5>Up Next</h5>
          {videoElements}
         </section>
      );
    }
  }
 export default VideoList;
